#
# Structure for table "normtarget"
#

DROP TABLE IF EXISTS `normtarget`;
CREATE TABLE `normtarget` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(255) DEFAULT NULL COMMENT '评价指标',
  `entropy` decimal(5,2) DEFAULT NULL COMMENT '权重 百分制',
  `sort` int(11) DEFAULT NULL COMMENT '排序码',
  `pid` bigint(20) DEFAULT NULL COMMENT '上级指标',
  `isNodelast` tinyint(1) DEFAULT NULL COMMENT '是否是子节点',
  `status` int(11) DEFAULT '1' COMMENT '是否启用（0：禁用，1：启用）',
  `is_show` tinyint(2) DEFAULT '1' COMMENT '是否显示',
  `level` bigint(2) DEFAULT NULL COMMENT '菜单层级',
  `r_id` bigint(20) DEFAULT NULL COMMENT '角色ID',
  PRIMARY KEY (`id`),
  KEY `FK_Reference_6` (`pid`),
  KEY `r_id` (`r_id`),
  CONSTRAINT `normtarget_ibfk_1` FOREIGN KEY (`r_id`) REFERENCES `sys_role` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=utf8 COMMENT='评价指标（oes_normtarget）';

